// src/pages/AdminDashboard.js
import React, { useState } from "react";

export default function AdminDashboard({ isAdmin }) {
  if (!isAdmin) return <h2>Access Denied</h2>;

  // Hardcoded users
  const [users, setUsers] = useState([
    { id: 1, name: "Alice", email: "alice@example.com", verified: false },
    { id: 2, name: "Bob", email: "bob@example.com", verified: true },
  ]);

  // Hardcoded POIs
  const [pois, setPois] = useState([
    { id: 1, name: "Taytay Falls", type: "nature", description: "Beautiful waterfall", visitors: "High" },
    { id: 2, name: "Majayjay Church", type: "history", description: "Historic church", visitors: "Very High" },
  ]);

  // Hardcoded Routes
  const [routes, setRoutes] = useState([
    { id: 1, name: "Nature Trail", poiIds: [1] },
    { id: 2, name: "Cultural Tour", poiIds: [2] },
  ]);

  // Users functions
  const verifyUser = (id) => setUsers(users.map(u => u.id === id ? { ...u, verified: true } : u));
  const deleteUser = (id) => setUsers(users.filter(u => u.id !== id));

  // POIs functions
  const addPOI = () => {
    const name = prompt("Enter POI name:");
    if (!name) return;
    const type = prompt("Enter type (nature/history/culture):");
    const description = prompt("Enter description:");
    const visitors = prompt("Visitors level (Very High/High/Moderate/Low):");
    const newPOI = { id: Date.now(), name, type, description, visitors };
    setPois([...pois, newPOI]);
  };

  const deletePOI = (id) => setPois(pois.filter(p => p.id !== id));

  // Routes functions
  const addRoute = () => {
    const name = prompt("Enter route name:");
    if (!name) return;
    const poiIds = prompt("Enter POI IDs in route (comma separated):")
      .split(",")
      .map(id => parseInt(id.trim()))
      .filter(id => pois.some(p => p.id === id));
    const newRoute = { id: Date.now(), name, poiIds };
    setRoutes([...routes, newRoute]);
  };

  const deleteRoute = (id) => setRoutes(routes.filter(r => r.id !== id));

  return (
    <div style={{ padding: 20 }}>
      <h1>Admin Dashboard</h1>

      {/* Users Section */}
      <section style={{ marginBottom: 40 }}>
        <h2>Registered Users</h2>
        <table border="1" cellPadding="8" style={{ borderCollapse: "collapse", width: "100%" }}>
          <thead>
            <tr>
              <th>ID</th><th>Name</th><th>Email</th><th>Verified</th><th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {users.map(u => (
              <tr key={u.id}>
                <td>{u.id}</td>
                <td>{u.name}</td>
                <td>{u.email}</td>
                <td>{u.verified ? "Yes" : "No"}</td>
                <td>
                  {!u.verified && <button onClick={() => verifyUser(u.id)}>Verify</button>}
                  <button onClick={() => deleteUser(u.id)} style={{ marginLeft: 8 }}>Delete</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </section>

      {/* POIs Section */}
      <section style={{ marginBottom: 40 }}>
        <h2>Points of Interest (POIs)</h2>
        <button onClick={addPOI} style={{ marginBottom: 10 }}>Add POI</button>
        <table border="1" cellPadding="8" style={{ borderCollapse: "collapse", width: "100%" }}>
          <thead>
            <tr><th>ID</th><th>Name</th><th>Type</th><th>Description</th><th>Visitors</th><th>Actions</th></tr>
          </thead>
          <tbody>
            {pois.map(p => (
              <tr key={p.id}>
                <td>{p.id}</td>
                <td>{p.name}</td>
                <td>{p.type}</td>
                <td>{p.description}</td>
                <td>{p.visitors}</td>
                <td><button onClick={() => deletePOI(p.id)}>Delete</button></td>
              </tr>
            ))}
          </tbody>
        </table>
      </section>

      {/* Routes Section */}
      <section>
        <h2>Tourism Routes</h2>
        <button onClick={addRoute} style={{ marginBottom: 10 }}>Add Route</button>
        <table border="1" cellPadding="8" style={{ borderCollapse: "collapse", width: "100%" }}>
          <thead>
            <tr><th>ID</th><th>Name</th><th>POIs</th><th>Actions</th></tr>
          </thead>
          <tbody>
            {routes.map(r => (
              <tr key={r.id}>
                <td>{r.id}</td>
                <td>{r.name}</td>
                <td>{r.poiIds.map(id => pois.find(p => p.id === id)?.name).join(", ")}</td>
                <td><button onClick={() => deleteRoute(r.id)}>Delete</button></td>
              </tr>
            ))}
          </tbody>
        </table>
      </section>
    </div>
  );
}
